function convertToArr(obj) {
  const result = [];
  for (const key in obj) {
    const value = obj[key];
    const item = {
      value: value.val,
      text: key,
      children: []
    };
    if (value.items) {
      for (const subKey in value.items) {
        const subValue = value.items[subKey];
        const subItem = {
          value: subValue.val,
          text: subKey,
          children: [] // Added for the third level
        };

        if (subValue.items) {
          for (const subSubKey in subValue.items) {
            const subSubValue = subValue.items[subSubKey];
            const subSubItem = {
              value: subSubValue,
              text: subSubKey
            };
            subItem.children.push(subSubItem);
          }
        }

        item.children.push(subItem);
      }
    }
    result.push(item);
  }
  return result;
}
